using Shouldly;
using System;
using System.Linq;
using System.Threading.Tasks;
using HRManagementSoftware.HRManagers;
using HRManagementSoftware.EntityFrameworkCore;
using Xunit;

namespace HRManagementSoftware.EntityFrameworkCore.Domains.HRManagers
{
    public class HRManagerRepositoryTests : HRManagementSoftwareEntityFrameworkCoreTestBase
    {
        private readonly IHRManagerRepository _hRManagerRepository;

        public HRManagerRepositoryTests()
        {
            _hRManagerRepository = GetRequiredService<IHRManagerRepository>();
        }

        [Fact]
        public async Task GetListAsync()
        {
            // Arrange
            await WithUnitOfWorkAsync(async () =>
            {
                // Act
                var result = await _hRManagerRepository.GetListAsync(
                    hRNumber: "",
                    department: ""
                );

                // Assert
                result.Count.ShouldBe(1);
                result.FirstOrDefault().ShouldNotBe(null);
                result.First().Id.ShouldBe(Guid.Parse("4f57cf28-42e0-4f4b-b816-9bc7143fe937"));
            });
        }

        [Fact]
        public async Task GetCountAsync()
        {
            // Arrange
            await WithUnitOfWorkAsync(async () =>
            {
                // Act
                var result = await _hRManagerRepository.GetCountAsync(
                    hRNumber: "",
                    department: ""
                );

                // Assert
                result.ShouldBe(1);
            });
        }
    }
}